import React from 'react';
import Img from '../assets/src/assets/img.png'; // Remplacez le chemin par le chemin de votre image

function Section() {
  const divStyle = {
    backgroundImage: `url(${img})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    // Autres styles CSS si nécessaire
    width: '100%',
    height: '700px', // Ajustez la hauteur selon vos besoins
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'flex-start',
    padding: '20px', // Espace intérieur pour le contenu
    color: 'white',
  };

  return (
    <div style={divStyle}>
      {/* Votre contenu à afficher par-dessus l'image de fond */}
      <h1 style={{ textAlign: 'left' }}>Contenu au-dessus de l'image de fond</h1>
      <p style={{ textAlign: 'left' }}>Autres éléments...</p>
    </div>
  );
}

export default Section;
